"""# **K - FOLD CROSS- VALIDATION:**

- K-fold cross-validation is a robust method for assessing the performance of machine learning models.

- It involves dividing the dataset into 'k' subsets, or folds, and training the model on 'k-1' folds while testing it on the remaining fold.

- This process is repeated 'k' times, with each fold serving as the test set once.
"""

from sklearn.model_selection import KFold, cross_val_score

k = 5
kf = KFold(n_splits=k, shuffle=True, random_state=4)

kf_results = {}

for name, clf in classifiers.items():

    try:

        accuracy_scores = cross_val_score(clf, X, y, cv=kf, scoring='accuracy')
        f1_scores = cross_val_score(clf, X, y, cv=kf, scoring='f1_weighted')

        kf_results[name] = {
            'Mean Accuracy': accuracy_scores.mean(),
            'Mean F1 Score': f1_scores.mean()
        }

    except Exception as e:

        print(f"Error encountered for classifier {name}: {e}")

kf_results_df = pd.DataFrame(kf_results).T

kf_results_df_sorted = kf_results_df.sort_values(by='Mean F1 Score', ascending=False)

