"""# **K-Means CLUSTERING:**

### **Determining the Optimal Value of K using WCSS and the Elbow Method:**

- To study the K-means algorithm, the first step is to decide the number of clusters.

- The K value signifies the number of clusters that the algorithm will identify in the dataset.

### **Within Cluster Sum of Squares (WCSS):**

- We use the WCSS metric to evaluate the choice of K. WCSS represents the total squared distance between each point in a cluster and the centroid of that cluster.

- Essentially, we choose a center point for a cluster and then calculate the distance of all points from that center.

- We sum these distances to obtain the WCSS value.

- Next, we will repeat this process for different values of K.

- The ideal value of K is typically the one that results in the minimum WCSS.


"""

from sklearn.cluster import KMeans

wcss = []
K_values = range(1, 11)

for k in K_values:
    kmeans = KMeans(n_clusters=k)
    kmeans.fit(pca_data)
    wcss.append(kmeans.inertia_)

"""###**The Elbow Method:**

- The Elbow method is a useful technique for selecting the best value of K.

- This method involves plotting the WCSS values against the number of clusters (K) and looking for a point where the rate of decrease sharply changes, resembling an **elbow.**
"""

plt.plot(K_values, wcss, color='red', linestyle='dashed', marker='o', markerfacecolor='blue', markersize=10)
plt.xticks(K_values)
plt.title('WCSS vs. Number of Clusters (K)')
plt.xlabel('Number of Clusters (K)')
plt.ylabel('WCSS')
plt.show()

"""###**Analyzing Clusters:**

In the elbow chart above, we observe that the **WCSS** value decreases significantly until **K = 2**. Therefore, we can conclude that the optimal value for **K** is **2** for the given data.

# **K-Means - MODEL BUILDING:**
"""

k = 2
kmeans = KMeans(n_clusters=k, init='k-means++')
pca_data['Cluster'] = kmeans.fit_predict(pca_data)
pca_data.head(20)

pca_data.tail(10)

centroids = kmeans.cluster_centers_
centroids

sns.pairplot(pca_data, hue='Cluster')
plt.show()

